import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Attractions from '../Pages/Attractions.js';
import AttractionProfile from '../Pages/AttractionProfile.js';

class AttractionRouter extends Component {
  render() {
    return (
      <div>
        <Route exact path={this.props.match.path} component={Attractions} />
        <Route
          path={`${this.props.match.path}/:attractionname`}
          component={AttractionProfile}
        />
      </div>
    );
  }
}

export default AttractionRouter;
